import React from 'react'
import "../stylesheets/Star.css"


class Star extends React.Component {

    render(){
        return (
            <div className={this.props.star.class_name} style={{
                left: this.props.star.left,
                top: this.props.star.top,
                backgroundColor: this.props.star.background_color
            }}>

            </div>
        )

    }
}

export default Star
